import React from 'react';
import SidebarItem from './SidebarItem';
import GitImg from '../../assets/icons/github-logo_icon-icons.com_73546.svg';
import LinkedIcon from '../../assets/icons/linkedin_icon-icons.com_65929.svg';
import InstIcon from '../../assets/icons/Instagram_icon-icons.com_66804.svg';

const items = [
  {
    id: 1,
    display: 'github',
    image: GitImg,
    path: '/',
  },
  {
    id: 2,
    display: 'instagram',
    image: InstIcon,
    path: '/',
  },
  {
    id: 3,
    display: 'linkedin',
    image: LinkedIcon,
    path: '/',
  },
];

const Sidebar = () => {
  return (
    <div className='sidebar'>
      <div className='sidebar-wrap'>
        {items.map((item) => (
          <SidebarItem key={item.id} item={item} />
        ))}
      </div>
    </div>
  );
};

export default Sidebar;
